import React, { useState} from 'react';
import Experiencies from "./Experiencies";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faSearch } from '@fortawesome/free-solid-svg-icons';

function ExperienciesList() {

    const [experiencia, setExperiencies] = useState([
        {id:1, title: "Limpiemos las playas", body: "Necesitan ayuda para limipiar la Barceloneta", image: null, owner: "Clara"},
        {id:2, title: "Ayuda para sintechos", body: "Muchas personas sin casa por Girona, ven a colaborar", image: null, owner: "Eustaquio"}
    ]);

    return (
    <div>
    {/*<!-- Topbar Search -->*/}
        <row >
            <span className="d-none d-sm-inline-block form-inline mr-auto ml-md-3 my-2 my-md-0 mw-100 navbar-search" >Busca per ciutat: </span>
            <form
                className="d-none d-sm-inline-block form-inline mr-auto ml-md-3 my-2 my-md-0 mw-100 navbar-search">
                <div className="input-group">
                    <input type="text" className="form-control bg-light border-0 small" placeholder="Search for..."
                        aria-label="Search" aria-describedby="basic-addon2"/>
                    <div className="input-group-append">
                        <button className="btn btn-primary" type="button">
                            <FontAwesomeIcon icon={faSearch} />  &nbsp; &nbsp;
                        </button>
                    </div>
                </div>
            </form>

        </row>

        {/*<!-- Experiencies listadas -->*/}
        { /*<!-- Divider -->*/}
        <hr className="sidebar-divider d-none d-md-block"/>
        <ul>
            {experiencia.map((volutariado) => (
                <Experiencies key={volutariado.id} experiencia={volutariado} />
            ))}
        </ul>
    </div>
    );

}
const fontSizeSearches = {
   fontSize: 10
};
export default ExperienciesList;
